import {useState} from 'react';
function F1(){
    const name =['virat','sehwag', 'sachin','rohit','nehra','gill','dravid']
    const [f, filterState] = useState([]);
    const handle = (event) =>{
        const list = name.filter(item => item.toLowerCase.indexOf(event.target.value.toLowerCase) !== -1)
        filterState(list);
    }
    return (
        <div>
            <input type="text" onChange={handle}></input>
            {
                f.map(name)(
                    <div>{name}</div>
                )
            }
        </div>
        
    );
}
export default F1;
